import React from 'react';

export default function Loading({className}) {
  return (
    <div>
      <img
        className={className}
        alt="loading"
        src="https://res.cloudinary.com/dhd9jgrw3/image/upload/v1587407007/drivers/logo/Infinity-1.3s-200px_iaggun.gif"
      />
    </div>
  );
}
